/* harmony default export */ __webpack_exports__["default"] = ("<style type=\"text/css\">\r\n    .custom-modalbox {\r\n        border-radius:10px !important;\r\n    }\r\n    .mat-dialog-content {\r\n        margin: 0 !important;\r\n    }\r\n</style>\r\n<div *ngIf=\"type=='DBS'\">\r\n    <h3 mat-dialog-title style=\"text-align:center; margin-top:20px;\">Enhanced DBS checks</h3>\r\n    <hr>\r\n    <div mat-dialog-content>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">1. Inorder to enable Enhanced DBS Badge on a Tutors profile, it is your responsibility to confirm that you have conducted an enhanced DBS check and validated the tutors Enhanced DBS status.</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">2. Click on the View tab on the right to see tutors details and certificate uploads.</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">3. Follow the link below to perform an Enhanced DBS check</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\"><a style=\"color:blue;\" href=\"https://secure.crbonline.gov.uk/crsc/check?execution=e1s1\" target=\"_blank\">https://secure.crbonline.gov.uk/crsc/check?execution=e1s1</a></p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">4. Enter Organisation name: Standing Out Ltd</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">5. Enter Forename: Dilbir</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">6. Enter Surname: Sahota</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">7. Enter tutors certificate number, surname and date of birth</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">8. Save DBS update verification received from secure.crbonline.gov.uk</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">9. Once validated select approve tutor and the Enhanced DBS status badge will appear on their profile</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">10. All Company DBS approvals will intern be validated by 2utoring.com safeguarding team</p>\r\n    </div>\r\n\r\n</div>\r\n\r\n<div *ngIf=\"type=='CAL'\">\r\n    <h3 mat-dialog-title style=\"text-align:center; margin-top: 15px;\">Availability Calendars</h3>\r\n    <hr>\r\n    <div mat-dialog-content>\r\n        <!--this is for during registration-->\r\n        <p *ngIf=\"!page\" style=\"text-indent:-1em; padding:0 0 0 20px;\">1. Select a day and add multiple teaching slots, these will populate the calendar.</p>\r\n        <p *ngIf=\"!page\" style=\"text-indent:-1em; padding:0 0 0 20px;\">2. To edit specific calendar dates, select the date within the calendar and add or remove time slots.</p>\r\n        <p *ngIf=\"!page\" style=\"text-indent:-1em; padding:0 0 0 20px;\">3. Within settings in your dashboard area you can add & modify your availability slots at any time.</p>\r\n\r\n        <!--this is for after login-->\r\n        <p *ngIf=\"page\" style=\"text-indent:-1em; padding:0 0 0 20px;\"> 1. Click on a day in the calendar below to add your availability slots.</p>\r\n        <p *ngIf=\"page\" style=\"text-indent:-1em; padding:0 0 0 20px;\"> 2. Select your start and finish time for that session. ( For example 16.00pm to 17.00pm ).</p>\r\n        <p *ngIf=\"page\" style=\"text-indent:-1em; padding:0 0 0 20px;\"> 3. To repeat this time slot, select the days this session time is available and the number of weeks you want it to appear on your calendar. Then click Update.</p>\r\n        <p *ngIf=\"page\" style=\"text-indent:-1em; padding:0 0 0 20px;\"> 4. Repeat points 1 - 3 until you have added all your availability slots.</p>\r\n        <p *ngIf=\"page\" style=\"text-indent:-1em; padding:0 0 0 20px;\"> 5. Once completed click on the Save button before exiting the page.</p>\r\n        <p *ngIf=\"page\" style=\"text-indent:-1em; padding:0 0 0 20px;\"> 6. To edit a session or a sequence simply click on the time slot in the calendar and then adjust the timings, click on Update and then press the Save button.</p>\r\n    </div>\r\n</div>\r\n\r\n\r\n\r\n\r\n<style>\r\n    .cirinfo p {\r\n        font-size: 15px;\r\n        font-weight: 600;\r\n        text-align: justify;\r\n    }\r\n\r\n    .cirinfo ul {\r\n        font-weight: 600;\r\n        font-size:15px;\r\n    }\r\n    .cirinfo ul li{\r\n        padding-left:1%;\r\n    }\r\n    .cirinfo table tr td {\r\n        border: 1px solid;\r\n        padding: 15px;\r\n        line-height: 2;\r\n    }\r\n</style>\r\n\r\n<div class=\"ng-star-inserted\" *ngIf=\"type=='CRI'\">\r\n    <h4 class=\"mat-dialog-title\" style=\"text-align:center; padding:1%; padding-bottom:0;\">Application for a new Enhanced DBS certificate and registration on the update service</h4>\r\n    <hr>\r\n    <div class=\"mat-dialog-content\" style=\"margin-left:0;line-height:1.5\">\r\n\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">2utoring is a corporate member of The Tutor Association (TTA) and conducts all DBS checks through them. At 2utoring our recommendation is that members would apply/have an Enhanced certificate if they work with children and / or vulnerable adults. Please be advised that you will need to pay {{51.89 | currency:'GBP':'symbol':'1.2-2'}} for your enhanced DBS certificate</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\">To access our DBS service, please follow the link and instructions shown below:</p>\r\n        <p style=\"text-indent:-1em; padding:0 0 0 20px;\"> <a href=\"https://disclosure.capitarvs.co.uk/cheqs\" target=\"_blank\">https://disclosure.capitarvs.co.uk/cheqs</a></p>\r\n        <ul style=\"list-style-type:decimal\">\r\n            <li>(click on the first, orange box to start the application).</li>\r\n            <li>\r\n                The login details are as follows (these are case sensitive)\r\n                <ul style=\"list-style-type:disc !important;\">\r\n                    <li>Organisation Reference<em> - </em>TTA</li>\r\n                    <li>Organisation Code<em> - </em>tutor2014</li>\r\n                </ul>\r\n            </li>\r\n            <li>\r\n                When you get to the regulated activities change this to Yes, then the 'Enhanced' certificate option will come up.\r\n            </li>\r\n            <li>\r\n                Once this is done, The Tutor Association will then request certified identity documents and complete the process for you.\r\n            </li>\r\n            <li>\r\n                Inform TTA that you are part of Standing Out Ltd - 2utoring.com.\r\n            </li>\r\n            <li>\r\n                After receiving your certification, you will need to register with the DBS update service within 30 days. 2utoring will not accept certificates that are not on the update service\r\n            </li>\r\n            <li>\r\n                Once completed and you have received your Enhanced DBS and are on the update service, please go <a href=\"/\" target=\"_blank\">2utoring.com</a>, log in and go to your DBS section in settings and update your information, for us to validate.\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n\r\n\r\n    <div *ngIf=\"type=='RDBS'\">\r\n        <h4 class=\"mat-dialog-title\" style=\"text-align:center;padding:1%; padding-bottom:0;\">Application for a new Enhanced DBS certificate and registration on the update service</h4>\r\n        <hr>\r\n        <div class=\"mat-dialog-content\" style=\"margin-left:0;line-height:1.5\">\r\n            <ul style=\"font-size:15px; text-align:left;line-height: 2;\">\r\n                <li>2utoring is a corporate member of The Tutor Association (TTA) and conducts all DBS checks through them.</li>\r\n                <li>At 2utoring our recommendation is that members would apply/have an Enhanced certificate if they work with children and / or vulnerable adults.</li>\r\n                <li>Please be advised that you will need to pay {{51.89 | currency:'GBP':'symbol':'1.2-2'}} for your enhanced DBS certificate</li>\r\n                <li>To access our DBS service, please use the link shown below here:\r\n                    <a style=\"text-decoration:none;\" href=\"https://disclosure.capitarvs.co.uk/cheqs/\" target=\"_blank\">https://disclosure.capitarvs.co.uk/cheqs</a>\r\n                </li>\r\n                <ul style=\"list-style-type: decimal;\">\r\n                        <li>(click on the first, orange box to start the application).</li>\r\n                        <li>The login details are as follows (these are case sensitive)\r\n                            <ul style=\"list-style-type: disc;\">\r\n                                <li> Organisation Reference <em>-</em> TTA</li>\r\n                                <li> Organisation Code      <em>-</em> tutor2014</li>\r\n                            </ul>\r\n                        </li>\r\n                        <li>When you get to the regulated activities change this to Yes, then the 'Enhanced' certificate option will come up.</li>\r\n                        <li>Once this is done, The Tutor Association will then request certified identity documents and complete the process for you.</li>\r\n                        <li>Inform TTA that you are part of Standing Out Ltd - 2utoring.com.</li>\r\n                        <li>After receiving your certification, you will need to register with the DBS update service within 30 days. 2utoring will not accept certificates that are not on the update service.</li>\r\n                        <li>Once completed and you have received your Enhanced DBS and are on the update service, please go 2utoring.com, log in and go to your DBS section in settings and update your information, for us to validate.</li>\r\n                    </ul>\r\n                    <!--<li> 2utoring.com will not accept certificates that are not on the update service</li>\r\n                    <li>Once completed and you have received your Enhanced DBS certificate and are on the update service, please go 2utoring.com, log in and go to your DBS section in settings and update your information, for us to validate.</li>\r\n                    <li>If you have any questions please contact us:  <a style=\"text-decoration:none;\" href=\"safeguarding@2utoring.com\">safeguarding@2utoring.com</a></li>\r\n                    <li>We at 2utoring look forward to you updating your information</li>-->\r\n                </ul>\r\n</div>\r\n    </div>\r\n\r\n\r\n\r\n\r\n    <div style=\"margin-top:12px;margin-bottom:75px; text-align:center\">\r\n        <button class=\"btn btn-primary btn-md\" mat-raised-button mat-dialog-close tabindex=\"-1\" (click)=\"onCancelClick()\">Close</button>\r\n    </div>\r\n");

